import React from 'react'
import { Link } from 'react-router-dom'

const More = () => {
  return (
    <>
        <div>More</div>
        <Link to='/'>Home</Link>
        <Link to='/'>More1</Link>
        <Link to='/'>More2</Link>
    </>
  )
}

export default More
